			EnumNames.Add(FName(TEXT("EEyeXDetectionMode::LineTrace")));
			EnumNames.Add(FName(TEXT("EEyeXDetectionMode::BoxedLineTrace")));
			EnumNames.Add(FName(TEXT("EEyeXDetectionMode::Sweep")));
			EnumNames.Add(FName(TEXT("EEyeXDetectionMode::FrustrumIntersection")));
			EnumNames.Add(FName(TEXT("EEyeXDetectionMode::EEyeXDetectionMode_MAX")));
